    <Post message={post.message} likesCount={post.likesCount} />
  ));

  return (
    <>
      <div>My posts</div>
      <div>
        new Posts
        <div>
          <textarea></textarea>
        </div>
        <button>Add post</button>
        <button>Remove</button>
      </div>
      <div className={classes.posts}>{postsElements}</div>
    </>
  );
};

export default MyPosts;
